description:
I Have a Wife - Ashley Adams [NEW August 12, 2015][480p]

Ashley Adams needs her client, Bruce, to sign his life insurance paperwork so she can close the deal. Bruce is a little hesitant to sign without his wife around to give the go ahead, but Ashley needs to close the deal ASAP and is willing to do anything to get Bruce's signature on those papers.

